  input: 'TEXT,F3XA,,"The Committee is in receipt of the Commission''s letter dated
    December 9th, 2005 regarding the 2005 July Monthly report.  1 - The totals listed
    on Lines 11ai and 11aii, Column B of the Detailed Summary Page have been corrected.  2
    - The receipt of 340.86 from the ASDC Partnership Program represents the transfer
    of joint fundraising proceeds from contributions raised during the 1st quarter
    of 2005.  The memo records for these receipts were included in the 2005 April
    Monthly report.  The memo Schedule A entries in this report represent the contributions
    raised in the second quarter of 2005.  The proceeds from these activities were
    received on July 29, 2005 and will be reported in the 2005 Year End Report.  The
    receipts from the WI State Party Victory reported during the months of April,
    May and June represent the transfer of joint fundraising proceeds from contributions
    raised during the 4th quarter of 2004 and the 1st quarter of 2004.  Memo Schedule
    A entries for these receipts were included in the Amended 2004 Year End Report
    filed on 11/20/2005.  3 - The receipt from the Battleground Victory Fund #3 represents
    a final distribution of fundraising activities which occurred in 2004.  Memo entries
    for these receipts were included in the 2004 Year End Report.  4 - No employee
    of the committee spent more than 25 percent of their time on Federal Election
    Activity during the reporting period.  Therefore, salaries were paid with non
    federal funds.  5 - The expenditures made for Equipment Rental on Schedule B were
    not made on the behalf of any specifically federal candidate.  6 - The payments
    for 2004 Advertising Expense were to advertise a generic Democratic Rally and
    did not promote, support, attack or oppose any candidate for federal office.  7
    - The transfer for Transfer to Cover County Co-Pay and the Transfer to Cover Payroll
